from base64 import b64decode
import math
from os import listdir, path, remove
from PIL import Image, ImageOps
import tkinter as tk
import webbrowser

window = tk.Tk()
window.title("Texture Matrix")
# ICON
icon = ""
""" BASE64 VERSION OF THE ICON """
iconData = b64decode(icon)
tempFile = "tkIcon.ico"  # Save base64 as temp ico
iconFile = open(tempFile, "wb")
iconFile.write(iconData)
iconFile.close()
window.wm_iconbitmap(tempFile)

mainFrame = tk.Frame(master=window, width=100, height=150)
mainFrame.pack(padx=5, pady=5)

show = tk.IntVar()


def create():
    startButton['text'] = "Started"
    textureDirEntry['state'] = 'disabled'
    itemSizeEntry['state'] = 'disabled'
    marginEntry['state'] = 'disabled'
    paddingEntry['state'] = 'disabled'
    checkEntry['state'] = 'disabled'

    textureDir = textureDirEntry.get()
    ui = [f for f in listdir(textureDir) if path.isfile(path.join(textureDir, f))]
    amount = math.ceil(math.sqrt(len(ui)))
    Matrix = [[0 for x in range(amount)] for y in range(amount)]

    # INPUTS
    itemSize = int(itemSizeEntry.get())
    margin = int(marginEntry.get())
    padding = itemSize + int(paddingEntry.get())

    resizeTo = eval(str(itemSize) + "," + str(itemSize))
    print('style="itemSize: ' + str(itemSize) + '; margin: ' + str(margin) + '; padding: '
          + str(padding) + '; resizeTo: ' + str(resizeTo) + ';"')

    dim = padding * amount + margin * 2
    back = Image.new('RGBA', (dim, dim), (15, 15, 15, 255))
    image = back.load()

    i = 0
    for r in range(amount):
        for c in range(amount):
            try:
                Matrix[r][c] = ui[i]
                file = (textureDir + '/' + ui[i])
                paste = Image.open(file)
                width, height = paste.size
                if width != height:
                    resize = math.ceil((height - width) / 2)
                    paste = ImageOps.expand(paste, resize, (0, 0, 0, 0))
                    paste = paste.crop((0, resize, height, height + resize))
                paste = paste.resize(resizeTo, Image.NEAREST)
                back.paste(paste, (padding * c + margin * 2, padding * r + margin * 2), paste)
            except IndexError:
                pass
            i += 1

    back.save("matrix.png")

    if show.get():
        with open('matrix.html', 'w', encoding="utf-8") as output_file:
            output_file.write(
                '<html style="height: 100%;"><head><meta name="viewport" content="width=device-width, mini'
                + 'mum-scale=0.1"/><link rel="shortcut icon" type="image/png" href="tkIcon.ico"/><title>matrix.png'
                + '</title></head><body style="margin:0px; background-color:#0e0e0e; background-image:url(matrix.png'
                + '); background-size:contain; background-repeat:no-repeat; background-position: center cent'
                + 'er;"></body></html>')
        webbrowser.open('matrix.html')

    startButton['state'] = 'normal'
    textureDirEntry['state'] = 'normal'
    itemSizeEntry['state'] = 'normal'
    marginEntry['state'] = 'normal'
    paddingEntry['state'] = 'normal'
    checkEntry['state'] = 'normal'
    startButton['text'] = "Restart"
    print('Process finished\n')


textureDirFrame = tk.Frame(master=mainFrame, width=150, height=150)
textureDirFrame.pack()
textureDirEntry = tk.Entry(master=textureDirFrame, width=20)
textureDirEntry.pack(side=tk.RIGHT)
textureDirEntry.insert(0, "textures")
textureDirLabel = tk.Label(master=textureDirFrame, text="Recipes Directory", width=15, anchor="e")
textureDirLabel.pack(side=tk.RIGHT)

checkFrame = tk.Frame(master=mainFrame, width=150, height=150)
checkFrame.pack()
checkRight = tk.Label(master=checkFrame, text="", width=13, anchor="e")
checkRight.pack(side=tk.RIGHT)
checkEntry = tk.Checkbutton(master=checkFrame, variable=show, onvalue=1)
checkEntry.pack(side=tk.RIGHT)
checkLabel = tk.Label(master=checkFrame, text="Open Images", width=15, anchor="e")
checkLabel.pack(side=tk.RIGHT)

messageFrame = tk.Frame(master=mainFrame, width=150, height=150)
messageFrame.pack()
messageLabel = tk.Label(master=messageFrame, text="Settings (px)", width=40)
messageLabel.pack()

itemSizeFrame = tk.Frame(master=mainFrame, width=150, height=150)
itemSizeFrame.pack()
itemSizeEntry = tk.Entry(master=itemSizeFrame, width=20)
itemSizeEntry.pack(side=tk.RIGHT)
itemSizeEntry.insert(0, "128")
itemSizeLabel = tk.Label(master=itemSizeFrame, text="Texture Size", width=15, anchor="e")
itemSizeLabel.pack(side=tk.RIGHT)

marginFrame = tk.Frame(master=mainFrame, width=150, height=150)
marginFrame.pack()
marginEntry = tk.Entry(master=marginFrame, width=20)
marginEntry.pack(side=tk.RIGHT)
marginEntry.insert(0, "8")
marginLabel = tk.Label(master=marginFrame, text="Margin", width=15, anchor="e")
marginLabel.pack(side=tk.RIGHT)

paddingFrame = tk.Frame(master=mainFrame, width=150, height=150)
paddingFrame.pack()
paddingEntry = tk.Entry(master=paddingFrame, width=20)
paddingEntry.pack(side=tk.RIGHT)
paddingEntry.insert(0, "16")
paddingLabel = tk.Label(master=paddingFrame, text="Padding", width=15, anchor="e")
paddingLabel.pack(side=tk.RIGHT)

startButton = tk.Button(master=mainFrame, text="Start", width=40, height=2, command=create)
startButton.pack(padx=5, pady=5)
bottomFrame = tk.Frame(master=mainFrame)
bottomFrame.pack()
creditLabel = tk.Label(master=bottomFrame, text="Created By ChauhanSai on GitHub", width=40)
creditLabel.pack()

# Run the application
window.mainloop()
remove(tempFile)  # Delete temp ico
if path.exists('matrix.html'):
    remove('matrix.html')
